INSERT INTO `cardio` (`id`, `cardioexercise_id`, `name`, `time`, `image`, `video`, `video_url`, `notes`, `equipments`, `created_at`, `updated_at`, `preferred_target`) VALUES
(1, 2, 'Jumping jacks', '', 'http://65.1.160.150/uploads/cardio/image/1663647960.jpg', '', 'https://www.youtube.com/watch?v=iSSAk4XCsRA', '<p>Jumping jacks are an efficient total-body workout that you can do almost anywhere. This exercise is part of what&rsquo;s called plyometrics, or jump training. Plyometrics is a combination of aerobic exercise and resistance work. This type of exercise works your heart, lungs, and muscles at the same time.</p>\r\n\r\n<p>Specifically, jumping jacks work your:</p>\r\n\r\n<ul>\r\n	<li>glutes</li>\r\n	<li>quadriceps</li>\r\n	<li>hip flexors</li>\r\n</ul>\r\n\r\n<p>Jumping jacks also involve your abdominal and shoulder muscles.</p>\r\n\r\n<p>Read on to learn more about the benefits of jumping jacks and how to incorporate them into your exercise routine.</p>', '3', '2022-09-20 09:56:00', '2022-09-20 09:56:00', NULL),
(8, 9, 'Cross Fit', '', 'http://65.1.160.150/uploads/cardio/image/1664178167.jpg', '', 'https://www.youtube.com/watch?v=P1g6tZg8eTo', '<p><em>CrossFit</em>&reg; is the principal strength and conditioning program for many police academies and tactical operations teams&nbsp;</p>', '3,7', '2022-09-26 01:12:47', '2022-09-26 01:12:47', NULL),
(10, 1, 'test', NULL, 'http://65.1.160.150/uploads/cardio/image/1668410567.jpg', NULL, NULL, NULL, '1', '2022-11-14 12:52:47', '2022-11-14 12:52:47', NULL),
(11, 5, 'test1', NULL, 'http://65.1.160.150/uploads/cardio/image/1668410715.jpg', NULL, NULL, NULL, '2', '2022-11-14 12:55:15', '2022-11-14 12:55:15', NULL),
