INSERT INTO `exercise` (`id`, `exercizetype_id`, `banner`, `title`, `description`, `benefits`, `equipment`, `duration`, `intensity`, `level`, `tags`, `type`, `video`, `voiceover`, `created_at`, `updated_at`, `weights`) VALUES
(3, 5, 'http://65.1.160.150/public/uploads/exercise/maxresdefault.jpg', 'Shoulder Gators', '<h2>Stand with the feet hip width apart and parallel. Place the fingertips behind the head on either side. Elbows wide. Keeping the hands behind the head close the elbow together to touch/open them back wide.</h2>', 'Increase the flexibility and range of motion of your deltoid muscle', '6,8,9', '', 'Low', '1', '', '', 'https://youtu.be/JWp8_LGkTR8', '', '2022-09-21 03:45:39', '2022-11-10 10:44:40', 'yes'),
(4, 10, 'http://65.1.160.150/uploads/exercise/banner/1663755929.jpeg', 'Knee Hugs', '<p><strong>Stand tall and alternate pulling one knee at a time to your chest, and hold the hug for a few seconds before switching legs.</strong></p>', 'Strengthens and tones the thighs, calves, and ankles.', '3,5', '', 'Low', '1', '', '', 'https://youtu.be/utF6byZHTY4', '', '2022-09-21 03:55:29', '2022-11-10 10:45:03', NULL),
(5, 2, '', 'Tin soldiers', '<p><strong>Kick one leg straight in front of you, while reaching for the foot with your opposite hand.</strong>&nbsp;<strong>Lower that leg while stepping forward, and then kick up the opposite leg too</strong></p>', 'Raises core temperature, Pairs well with other dynamic warm-ups in a circuit, Stretches hamstrings and upper back, Warms up hip flexors and core', '1', '', 'Low', 'Pro', '', '', 'https://youtu.be/J5R36QbhWf0', '', '2022-09-21 03:58:52', '2022-09-21 03:58:52', NULL),
(6, 2, 'http://65.1.160.150/uploads/exercise/banner/1663756330.jpeg', 'World\'s Greatest Stretch', '<ol>\r\n	<li>From a high-plank position, step your right foot to the side of your right hand.</li>\r\n	<li>Press your left hand into the ground and bring your right hand overhead. Twist your body to the right side, and bring your gaze to the lifted fingertips.</li>\r\n	<li>Reverse the movement, and repeat on the opposite side.</li>\r\n</ol>', 'This dynamic stretch requires a fair bit of movement and transitions, so you\'re working a variety of muscle groups. Planks are a full-body move and a part of this stretch, activating your legs, arms, core, and glutes.  The move also does a great job of stretching your hips, your chest, all parts of your back, along with your shoulders and neck.', '1', '', 'Low', 'Pro', '', '', 'https://youtu.be/fZjsqgd-EaQ', '', '2022-09-21 04:02:10', '2022-09-21 04:02:10', NULL),
(7, 2, 'http://65.1.160.150/uploads/exercise/banner/1663756751.jpg', 'Walkouts', '<p>1 -&nbsp;Start with your feet hip-width apart. Bending from your hips, reach for the ground and place your palms on the floor in front of your feet.</p>\r\n\r\n<p>2 -&nbsp;Slowly shift your weight onto your hands and begin walking them forward until your body is in on straight line from your head to your heels.</p>\r\n\r\n<p>3 -&nbsp;Keep walking until your body is in a straight line from your head to your heels, bracing your core and making sure your hands are stacked directly under your shoulders.</p>', 'Walkouts will get the blood flowing to and stretch out your hamstrings, calves, glutes and lower back', '1', '', 'Low', 'Pro', '', '', 'https://youtu.be/-FW8DNKsAh8', '', '2022-09-21 04:09:11', '2022-09-21 04:09:11', NULL),
(8, 2, 'http://65.1.160.150/uploads/exercise/banner/1663757018.webp', 'Inchworm', '<ol>\r\n	<li>Start standing with your feet together.</li>\r\n	<li>Forward fold with straight legs, and place your hands on the floor.</li>\r\n	<li>Walk your hands out until you are in a plank position with shoulders over your wrists.</li>\r\n	<li>Bend your elbows and bring your chin and chest to the floor. Your elbows should form a 45-degree angle with your shoulder joints.</li>\r\n	<li>Press back up to your plank.</li>\r\n	<li>Walk your hands back in toward your feet, keeping your legs as straight as possible.</li>\r\n	<li>Roll back up to a standing position, with control.&nbsp;</li>\r\n</ol>', 'The inchworm offers a whole host of benefits, namely strengthening the core, shoulders, back and chest, whilst simultaneously stretching out the hamstrings and calves.', '1', '', 'Low', 'Rookie', '', '', 'https://youtu.be/VSp0z7Mp5IU', '', '2022-09-21 04:13:38', '2022-09-21 04:13:38', NULL),
(9, 2, 'http://65.1.160.150/uploads/exercise/banner/1663757899.png', 'Downward Dog', '<ol>\r\n	<li>Come onto your fours. Form a table such that your back forms the table top and your hands and feet form the legs of the table.</li>\r\n	<li>As you breath out lift the hips up, straightening the knees and elbows, form an inverted V-shape with the body.&nbsp;</li>\r\n	<li>Hands are shoulder width apart, feet are hip width apart and parallel to each other. Toes point straight ahead.</li>\r\n	<li>Press your hands into the ground. Widen through the shoulder blades. Keep the neck&nbsp;lengthened&nbsp;by touching the ears to the inner arms.&nbsp;</li>\r\n	<li>Hold the downward dog pose and take long deep breaths. Look towards the navel.</li>\r\n	<li>Exhale. Bend the knees,&nbsp;<strong>return to table pose. Relax.</strong></li>\r\n</ol>', 'Strengthens the Arms and Shoulders, Tones the Core and Waist, Lengthens the Hamstrings and Calves, Brings Blood Flow to the Brain, Stretches the Spine and Strengthens the Back', '1', '', 'Low', 'Rookie', '', '', 'https://youtu.be/ED6KwitZaIw', '', '2022-09-21 04:28:19', '2022-09-21 04:28:19', NULL),
(10, 6, 'http://65.1.160.150/uploads/exercise/banner/1663758196.jpeg', 'Dumbbell Incline Bench Press', '<ol>\r\n	<li>Sit on a bench, and lift a pair of dumbbells up to the starting position.</li>\r\n	<li>Press the dumbbells up to straight arms, while exhaling.</li>\r\n	<li>Inhale at the top, or while lowering the dumbbells with control back to your shoulders.</li>\r\n</ol>', 'Great for building muscle and strength, Builds your upper chest, Prevent muscle imbalance, Easy on the shoulders', '3,10', '', 'Medium', 'Intermediate', '', '', 'https://youtu.be/qSmo-8QapTg', '', '2022-09-21 04:33:16', '2022-09-21 04:33:16', NULL),
(11, 7, 'http://65.1.160.150/uploads/exercise/banner/1663758660.webp', 'Chin-up', '<ol>\r\n	<li>Start by grabbing the chin-up bar with an underhand grip&mdash;your palms facing toward you. Your grip should be shoulder-width. If you&rsquo;re unable to grab the chin-up bar, stand on a plyometric box or a secure flat bench.</li>\r\n	<li>Step off of the box and allow your legs to hang. Your arms and legs should be long. Your elbows should be slightly bent.</li>\r\n	<li>Squeeze your glutes and quads and engage your core. Rotate your shoulders outward to engage your lats. Your shoulder blades should be upwardly rotated away from your spine. Your chin should remain tucked throughout the movement, as if you were holding an egg under your chin. Begin all repetitions from this position.</li>\r\n	<li>Initiate the upward movement by simultaneously pulling your shoulder blades down and pulling your elbows towards your body. Continue to pull your shoulder blades toward your spine and squeeze your upper back and lat muscles until your collar bone reaches the chin-up bar.</li>\r\n	<li>Pause for a second at the top of the movement.</li>\r\n	<li>Begin the downward movement by simultaneously straightening your arms and allowing your shoulder blades to downwardly rotate and move away from your spine. Slowly lower your body back to the starting position. Your arms should be long with slight bend in your elbows.</li>\r\n</ol>', 'Chin-ups can help improve grip strength, posture and appearance, while also helping to strengthen muscles that stabilize the spine.', '11', '', 'Medium', 'Pro', '', '', 'https://youtu.be/b-ztMQpj8yc', '', '2022-09-21 04:41:00', '2022-09-21 04:41:00', NULL),
(12, 5, '', 'Dumbbell Shoulder Press', '<p>1. While holding a dumbbell in each hand, sit on a military press bench or utility bench that has back support. Place the dumbbells upright on top of your thighs. 2. Now raise the dumbbells to shoulder height one at a time using your thighs to help propel them up into position. 3. Make sure to rotate your wrists so that the palms of your hands are facing forward. This is your starting position. 4. Now, exhale and push the dumbbells upward until they touch at the top. 5. Then, after a brief pause at the top contracted position, slowly lower the weights back down to the starting position while inhaling. 6. Repeat for the recommended amount of repetitions.</p>', 'Increased Muscle Mass, Joint and Movement Integrity, Address Movement and Muscular Asymmetries', '3', '', 'Medium', 'Intermediate', '', '', 'https://youtu.be/0JfYxMRsUCQ', '', '2022-09-21 04:45:40', '2022-09-21 04:45:40', NULL),
(13, 7, 'http://65.1.160.150/uploads/exercise/banner/1663759291.webp', 'Dumbbell Hammer Bicep Curls', '<ol>\r\n	<li>Bend at the elbow, lifting the lower arms to pull the weights toward the shoulders. Your upper arms are stationary, and your wrists align with the forearms.</li>\r\n	<li>Hold for one second at the top of the movement. Your thumbs will be close to the shoulders and palms facing toward the body&#39;s midline.</li>\r\n	<li>Lower the weights to return to the starting position.</li>\r\n</ol>', 'Increases bicep size and strength Improves wrist stability Boosts muscle endurance Strengthens grip', '3', '', 'Medium', 'Rookie', '', '', 'https://youtu.be/0IAM2YtviQY', '', '2022-09-21 04:51:31', '2022-09-21 04:51:31', NULL),
(15, 12, 'http://65.1.160.150/uploads/exercise/banner/1663759515.jpg', 'Dumbbell Triceps Kick Back', '<p>1. Grab a set of dumbbells, bring your torso forward and bend your knees slightly.<br />\r\n2. Bring your elbows up, so that your upper arms are parallel to the floor, and kick back until your arms are fully extended.<br />\r\n3. Slowly lower the weights to the starting position.<br />\r\n4. Repeat.</p>', 'The dumbbell triceps kickback targets the triceps, in particular, its lateral head, which is the most visible of the three heads. This exercise helps to sculpt and tone your arms, increases your physical strength and also helps to trim body fat.', '3', '', 'Medium', 'Intermediate', '', '', 'https://youtu.be/ShCYaoHmWmk', '', '2022-09-21 04:55:15', '2022-09-21 04:55:15', NULL),
(16, 5, 'http://65.1.160.150/uploads/exercise/banner/1663759792.jpg', 'Dumbbell Lateral Raise', '<p>The dumbbell lateral raise will correct any imbalances you have on your shoulders. When performing a bench press with a barbell, for example, one arm might overpower the other arm when lifting. The dumbbell lateral raise does not have that problem as you utilize two dumbbells of the same weight for each arm.</p>', 'The dumbbell lateral raise will correct any imbalances you have on your shoulders. When performing a bench press with a barbell, for example, one arm might overpower the other arm when lifting. The dumbbell lateral raise does not have that problem as you utilize two dumbbells of the same weight for each arm.', '3', '', 'Medium', 'Intermediate', '', '', 'https://youtu.be/XPPfnSEATJA', '', '2022-09-21 04:59:52', '2022-09-21 04:59:52', NULL),
(17, 9, 'http://65.1.160.150/uploads/exercise/banner/1663760049.jpg', 'Lying Straight-Leg Raise', '<ul>\r\n	<li>Make sure that you tuck your shoulders down and orient your palms to the sky.</li>\r\n	<li>Keep your knees well bent while you support your low back.</li>\r\n	<li>Slide out the leg your going raise.</li>\r\n	<li>This is a nice opportunity to stretch your toes before we begin the rest of the exercise. (You can never get enough toe stretches!)</li>\r\n	<li>Keep your toes pointed towards your nose and raise your leg.</li>\r\n	<li>Lift your leg no higher than the opposite thigh.</li>\r\n	<li>Pause.</li>\r\n	<li>Bring the leg down in a controlled manner (do not drop!)</li>\r\n	<li>Pay special attention to your breathing through the movement and make a point of&nbsp;not&nbsp;holding your breath.</li>\r\n</ul>', 'The straight leg raise exercise strengthens the muscles of the upper thigh, the quadriceps, without placing any stress on the knee joint.', '1', '', 'Medium', 'Intermediate', '', '', 'https://youtu.be/Zr-PtqcpeWM', '', '2022-09-21 05:04:09', '2022-09-21 05:04:09', NULL),
(28, 9, 'http://65.1.160.150/uploads/exercise/banner/1668083874.jpg', 'Bird Dog', '<p>Get on all fours with wrists under armpits and knees under hips (Quadruped position) -Keep your lower ribs up while you raise one arm (DO NOT SHRUG) and the opposite leg (DON&#39;T GO SO HIGH THAT YOU ARCH) -Return to the starting position and alternate sides for the prescribed reps -MAKE SURE YOU DON&#39;T LET YOUR HIPS SHOOT TO ONE SIDE WHEN DOING EACH REP AS IS COMMON- You got thi</p>', 'The bird dog is a simple core exercise that improves stability, encourages a neutral spine, and relieves low back pain. This exercise pose uses the whole body to target and strengthen your core, hips, and back muscles. It also helps promote proper posture and increase range of motion.', '1', '', 'Low', '1', '', '', 'https://youtu.be/iMi-xcc7BoA', '', '2022-11-10 06:07:54', '2022-11-10 06:10:00', 'no'),
(29, 3, 'http://65.1.160.150/uploads/exercise/banner/1668084250.jpg', 'Lateral Neck Stretch', '<p>1. Stand straight with your feet hip-width apart and tilt your head toward the shoulder.<br />\r\n2. Place your hand on your head and gently pull until you feel the stretch in your neck.<br />\r\n3. Hold for 10 to 15 seconds and repeat on the other side.</p>', 'Stretching your neck at the end of your workout routine helps to increase flexibility, improves range of motion, and reduces muscle soreness. Adding this stretch to your everyday routine helps to remove tension, muscle knots, and tightness in the neck.', '1', '', 'Low', '1', '', '', 'https://youtu.be/d81ppMTJbJc', '', '2022-11-10 06:14:10', '2022-11-10 06:14:10', 'no'),
(30, 6, 'http://65.1.160.150/uploads/exercise/banner/1668085214.jpg', 'Decline Push-up', '<ol>\r\n	<li>Kneel down with your back to the bench. Put your hands on the floor, shoulders over your wrists and elbows at 45 degrees. Place your feet on top of the bench.</li>\r\n	<li>Brace your core, glutes, and quads. Bend your elbows and lower your chest to the floor, keeping your back and neck straight.</li>\r\n	<li>Push into the floor to return to starting position, extending your elbows.</li>\r\n</ol>', 'The main benefit of doing decline pushups is building strong upper chest muscles.  In a decline pushup, your arms push up and away from your torso.  This movement works your upper pecs and the muscles in your shoulders.  When done regularly, decline pushups will help increase your overall upper-body strength.', '1', '', 'High', '3', '', '', 'https://youtu.be/Wrs5OXvu1zo', '', '2022-11-10 06:30:14', '2022-11-10 06:30:14', 'no'),
(32, 2, 'http://65.1.160.150/public/uploads/exercise/download (2).jpg', 'Test', NULL, NULL, '2', NULL, NULL, '1', NULL, NULL, 'http://65.1.160.150/uploads/exercise/video/1668424312.jpg', NULL, '2022-11-14 12:29:43', '2022-11-14 04:42:26', NULL),
