INSERT INTO `recipes` (`id`, `food_id`, `preparation_time`, `cooking_time`, `serving`, `ingredients`, `instruction`, `description`, `created_at`, `updated_at`, `how_to_make`, `image`, `image_url`, `video_url`) VALUES
(1, 1, '30', 0, '5', '', '', 'Oats Cookies', NULL, NULL, '<h2><strong>Ingredients</strong></h2>\r\n\r\n<ul>\r\n	<li>2&nbsp;cups&nbsp;all-purpose flour</li>\r\n	<li>1 &frac12;&nbsp;teaspoons&nbsp;ground cinnamon</li>\r\n	<li>1&nbsp;teaspoon&nbsp;baking soda</li>\r\n	<li>1&nbsp;teaspoon&nbsp;salt</li>\r\n	<li>1&nbsp;cup&nbsp;unsalted butter, softened</li>\r\n	<li>1&nbsp;cup&nbsp;white sugar</li>\r\n	<li>1&nbsp;cup&nbsp;packed brown sugar</li>\r\n	<li>2&nbsp;large&nbsp;eggs</li>\r\n	<li>1&nbsp;teaspoon&nbsp;vanilla extract</li>\r\n	<li>3&nbsp;cups&nbsp;quick cooking oats</li>\r\n	<li>nonstick cooking spray with flour</li>\r\n	<li>2&nbsp;tablespoons&nbsp;water</li>\r\n	<li>2&nbsp;tablespoons&nbsp;white sugar, or as needed</li>\r\n</ul>\r\n\r\n<h2><strong>How to Make Oatmeal Cookies</strong></h2>\r\n\r\n<p>You&#39;ll find the full, step-by-step recipe below &mdash; but here&#39;s a brief overview of what you can expect when you make these top-rated oatmeal cookies:</p>\r\n\r\n<ol>\r\n	<li><strong>Make the dough</strong>: Whisk the dry ingredients in a medium bowl. In a separate bowl, beat the butter and sugar. Beat in the eggs and vanilla. Add the dry mixture to the wet mixture, then stir in the oats. Cover and chill for at least one hour (this step is important to prevent spreading!).</li>\r\n	<li><strong>Roll the cookies</strong>: Roll the chilled dough into balls and place the balls on baking sheets. Dip a fork in water, then in sugar. Use the fork to flatten each dough ball.</li>\r\n	<li><strong>Bake the cookies</strong>: Bake in the preheated oven until the edges are golden brown and the centers are nearly set. Cool on the baking sheet for 5 minutes, then transfer to a wire rack.</li>\r\n</ol>\r\n\r\n<p><strong>Optional mix-ins</strong>: Raisins, dried cranberries, white chocolate chips, chocolate chips, walnuts, pecans, or shredded coconut</p>\r\n\r\n<h2><strong>Directions</strong></h2>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Whisk flour, cinnamon, baking soda, and salt together in a medium bowl until well combined.</p>\r\n	</li>\r\n	<li>\r\n	<p>Beat butter, 1 cup white sugar, and brown sugar in a large bowl with an electric mixer until creamy, at least 2 to 3 minutes. Beat in eggs, one at a time, then mix in vanilla. Gradually mix in dry ingredients until well combined. Add oats and mix until thoroughly incorporated. Cover the bowl and chill dough in the refrigerator for at least 1 hour.</p>\r\n	</li>\r\n	<li>\r\n	<p>When ready to bake, preheat the oven to 375 degrees F (190 degrees C). Spray two cookie sheets with floured cooking spray. Place water in a small bowl and 2 tablespoons sugar in another small bowl.</p>\r\n	</li>\r\n	<li>\r\n	<p>Roll chilled dough into walnut-sized balls, and place 2 inches apart on the prepared cookie sheets. Dip a large fork in water, then in sugar, and use to flatten each cookie, rewetting and resugaring as necessary.</p>\r\n	</li>\r\n	<li>\r\n	<p>Bake in the preheated oven until light golden brown around the edges and centers are nearly set, 8 to 10 minutes, switching racks halfway through. Allow cookies to cool on baking sheet for 5 minutes before transferring to a wire rack to cool completely.</p>\r\n	</li>\r\n</ol>', '1663653370.jpg', 'http://65.1.160.150/uploads/program/image/1663653370.jpg', NULL),
(2, 3, '25', 0, '4', '', '', NULL, NULL, NULL, '<p>To make this scrambled eggs recipe, you&rsquo;ll need 5 basic ingredients:</p>\n\n<ol>\n	<li><strong>Eggs</strong>, of course! Use the freshest ones you can find, from a local source if possible (we like&nbsp;<a href=\"https://amzn.to/2Slqdy0\" target=\"_', NULL, NULL, NULL);
